import axios from 'axios';

const API_URL = 'http://localhost:5000/api';

export const registerUser = async (email, password) => {
    return await axios.post(`${API_URL}/register`, { email, password });
};

export const loginUser = async (email, password) => {
    return await axios.post(`${API_URL}/login`, { email, password });
};

export const fetchQuestions = async () => {
    return await axios.get(`${API_URL}/questions`);
};

export const submitScore = async (userId, score) => {
    return await axios.post(`${API_URL}/score`, { userId, score });
};

export const submitFeedback = async (userId, feedbackText) => {
    return await axios.post(`${API_URL}/feedback`, { userId, feedbackText });
};
